import { useDispatch, useSelector } from 'react-redux';

function Todos() {
    const dispatch = useDispatch();
    const todos = useSelector(state => state.todos)
    console.log(todos); 
  return (
    <>
    <div>Todos</div>
    {
        todos.map((todo) => {
            console.log(todo.id);
            <p key={todo.id}>{todo.text}</p>
        })
    }
    </>
  )
}

export default Todos
